import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import Nav1 from "./Nav123";
import Top from "./Top";
import "./css/Manage.css";

const Manage = () => {
  const [myCreatedGroups, setMyCreatedGroups] = useState([]);
  const [myJoinedGroups, setMyJoinedGroups] = useState([]);
  const [showModal, setShowModal] = useState(false);
  const [newGroupName, setNewGroupName] = useState("");
  const [newGroupId, setNewGroupId] = useState("");

  // 미팅정보 가져오기
  const [meeting, setMeeting] = useState([
    {
      id: 1,
      meetingName: "첫번째 모임",
      userEmail: "11@11",
    },
    {
      id: 2,
      meetingName: "첫번째 모임",
      userEmail: "11@11",
    },
  ]);
  const [meeting2, setMeeting2] = useState([
    {
      id: 3,
      meetingName: "첫번째 참여 모임",
      userEmail: "11@11",
    },
    {
      id: 4,
      meetingName: "두번째 참여 모임",
      userEmail: "11@11",
    },
  ]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetch("/api/meetings/organizer")
      .then((response) => {
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        return response.json();
      })
      .then((data) => {
        console.log(data);
        setMeeting2(data);
        setLoading(false);
      })
      .catch((error) => {
        setError(error);
        setLoading(false);
      });
  }, []);

  useEffect(() => {
    fetch("/api/meetings/partcipant")
      .then((response) => {
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        return response.json();
      })
      .then((data) => {
        setMeeting(data);
        setLoading(false);
      })
      .catch((error) => {
        setError(error);
        setLoading(false);
      });
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  const handleCreateGroup = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch("/api/meetings", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ meetingName: newGroupName }),
      });

      if (response.ok) {
        const newGroup = await response.json();
        setMyCreatedGroups([...myCreatedGroups, newGroup]);
        setShowModal(false);
        setNewGroupName("");
        setNewGroupId("");
        alert("모임이 성공적으로 생성되었습니다.");
      } else {
        console.error("Failed to create group");
        alert("모임 생성 중 오류가 발생했습니다.");
      }
    } catch (error) {
      console.error("Error creating group:", error);
      alert("네트워크 오류가 발생했습니다.");
    }
  };

  return (
    <div>
      <Top />
      <div className="manage-container">
        <div className="manage-header">
          <h2>내가 만든 모임</h2>
          <button className="make-button" onClick={() => setShowModal(true)}>
            모임 만들기
          </button>
        </div>
        <div>
          {meeting.map((meeting, index) => (
            <Link
              to={{ pathname: `/board/${meeting.id}`, state: meeting }}
              key={index}
            >
              <div className="groupname">
                <p>모임 이름: {meeting.meetingName}</p>
                <p>이메일: {meeting.userEmail}</p>
              </div>
            </Link>
          ))}
        </div>
        <h2>내가 참여 중인 모임</h2>
        <div>
          {meeting2.map((meeting2, index) => (
            <Link to={`/board/${meeting2.id}`} key={index}>
              <div className="groupname">
                <p>모임 이름: {meeting2.meetingName}</p>
                <p>이메일: {meeting2.userEmail}</p>
              </div>
            </Link>
          ))}
        </div>
      </div>
      {showModal && (
        <div className="modal">
          <div className="modal-content">
            <h2>새 모임 만들기</h2>
            <form onSubmit={handleCreateGroup}>
              <label>
                모임 이름:
                <input
                  type="text"
                  value={newGroupName}
                  onChange={(e) => setNewGroupName(e.target.value)}
                  required
                />
              </label>
              <button type="submit">생성</button>
              <button type="button" onClick={() => setShowModal(false)}>
                취소
              </button>
            </form>
          </div>
        </div>
      )}
      <Nav1 />
    </div>
  );
};

export default Manage;
